  styleUrls: ['./view-contracts.component.css']
})
export class ViewContractsComponent implements OnInit {
  user = {
    id: '',
    name: '',
  };
  constructor(private route: ActivatedRoute) {}

  ngOnInit() {
    const user = {
      id: this.route.snapshot.params['id'],
      name: this.route.snapshot.params['name'],
    }


  }

